PREFIX qpr: <http://istresearch.com/qpr>
SELECT (MAX(?price) AS ?max_price) 
WHERE
{	?ad a qpr:Ad ;
	qpr:seed '+6592435711' ;
	qpr:price ?price ;
	qpr:ad ?ad .
}
GROUP BY ?price
ORDER BY DESC(?count)
LIMIT 1

